CREATE Database NETFLIX_DATABASE_India;
USE NETFLIX_DATABASE_India;
CREATE TABLE customer(
   Customer_Id  INTEGER  NOT NULL PRIMARY KEY 
  ,First_Name   VARCHAR(15) NOT NULL
  ,Last_Name    VARCHAR(15) NOT NULL
  ,Email_ID     VARCHAR(32) NOT NULL
  ,Password     VARCHAR(30) NOT NULL
  ,Phone_Number VARCHAR(20) NOT NULL
  ,State        VARCHAR(19) NOT NULL
  ,Country      VARCHAR(13) NOT NULL
  ,Sign_up_date DATE
);


CREATE TABLE Invoice(
   Invoice_number INTEGER  NOT NULL PRIMARY KEY 
  ,Customer_id    INTEGER  NOT NULL 
  ,Sign_up_date   VARCHAR(13) NOT NULL
  ,Plan           VARCHAR(8) NOT NULL
  ,Service_period VARCHAR(25) NOT NULL
  ,Payment_method VARCHAR(15) NOT NULL
  ,Total          VARCHAR(30) NOT NULL
);

CREATE TABLE streams (
	Stream_id INT NOT NULL PRIMARY KEY,
	Customer_id INT, 
	Content_id INT,
	Stream_date DATE,
	Stream_time VARCHAR(20),
	Stream_duration INT,
	Stream_rating INT
);

CREATE TABLE content(
   content_id      INTEGER  NOT NULL PRIMARY KEY 
  ,title           VARCHAR(40) NOT NULL
  ,episode         INTEGER  NOT NULL
  ,genre           VARCHAR(29) NOT NULL
  ,duration        INTEGER  NOT NULL
  ,cost_per_stream VARCHAR(10) NOT NULL
  ,release_date    DATE NOT NULL
  ,Production_companies VARCHAR(60) NOT NULL
);
















 